import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import reportWebVitals from './reportWebVitals';
import SelectCar from './components/frontPage/Index';
import SelectModel from './components/frontPage/selectModel';
import CarDesc from './components/frontPage/carDesc';

import { Router, Route, Link, browserHistory, IndexRoute } from 'react-router-dom';

// ReactDOM.render(
//   <React.StrictMode>
//     <SelectCar />
//   </React.StrictMode>,
//   document.getElementById('root')
// );

ReactDOM.render((
  <Router history = {browserHistory}>
     <Route path = "/" component = {SelectCar}>
        <IndexRoute component = {SelectCar} />
        <Route path = "/model" component = {SelectModel} />
        <Route path = "/desc" component = {CarDesc} />

     </Route>
  </Router>
), document.getElementById('root'))


// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
